import './App.css';
import { useState } from "react";
import NavBar from "./components/NavBar";

import Home from "./pages/Home";
import HowItWorks from "./pages/HowItWorks";

function App() {
  const [page, setPage] = useState("home");

  const pages = {
    home: <Home />,
    how: <HowItWorks />
  };

  return (
    <div>
      <NavBar setPage={setPage} />
      {pages[page]}
    </div>
  );
}

export default App;
